import {
  Button,
  message,
  Steps,
  theme,
  Cascader,
  DatePicker,
  Form,
  Input,
  InputNumber,
  Radio,
  Select,
  Switch,
  TreeSelect,
} from "antd";
import { useState } from "react";
const PersonalDetails = () => {
  const [current, setCurrent] = useState(0);
  return (
    <div>
      <Steps style={{ padding: "32px 16px" }}>
        <Steps.Step title="Personal Details" />
        <Steps.Step title="Contact Details" />
        <Steps.Step title="Finish" />
      </Steps>
    </div>
  );
};
export default PersonalDetails;
